import React, { Component } from "react";
import { Link } from "react-router-dom";

import axios from "axios";

import CarTable from "./CarTable";

import Header from "./Header";
import Footer from "./Footer";
//import Product from "./Product";

import {
  ACCESS_LEVEL_GUEST,
  ACCESS_LEVEL_ADMIN,
  SERVER_HOST,
} from "../config/global_constants";

export default class DisplayAllCars extends Component {
  constructor(props) {
    super(props);

    this.state = {
      cars: [],
      appTitle: "Customers",
      customersCount:5
    };
  }

  componentDidMount() {
    axios
      .get(`${SERVER_HOST}/cars`)
      .then((res) => {
        this.setState({ cars: res.data });
      })
      .catch((err) => {
        // do nothing
      });
  }

  render() {
    return (
      <div className="outer__container">
        <Header />
        <h4>{this.state.appTitle} </h4>
        <span className="badge badge-secondary m-2">{ this.state.customersCount}</span>
        <button class></button>
        <div className="container">
          <CarTable cars={this.state.cars} />
        </div>
        {localStorage.accessLevel >= ACCESS_LEVEL_ADMIN ? (
          <div className="add-new-car">
            <Link className="blue-button" to={"/AddCar"}>
              Add New Car
            </Link>
            <Link className="header__link" to={"/ResetDatabase"}>
              <div className="header__option">
                <span className="header__optionLineOne"></span>
                <span className="blue-button">Reset Database</span>
              </div>
            </Link>{" "}
          </div>
        ) : null}

        <Footer />
      </div>
    );
  }
}

